import React, { Component } from 'react';
import SystemStatus from './b2b-system-status/b2b-system-status.smart';
import ProductDetails from './b2b-product-details/b2b-product-details.smart';
import TechnicalDetails from './b2b-technical-details/b2b-technical-details.smart';
import OutageDetails from './b2b-outage-details/b2b-outage-details.smart';
import { ErrorBoundary } from '../../error-boundaries/error-boundary.dumb';

class MainContentRight extends Component {

    render() {
        const { expandCard } = this.props;
        return (
            <div id="mainContentRight" className={` overflow-y-auto`}>
                <ErrorBoundary failedComponent={`SystemStatus`}>
                    <SystemStatus expandCard={expandCard} />
                </ErrorBoundary>
                <ErrorBoundary failedComponent={`OutageDetails`}>
                    <OutageDetails expandCard={expandCard} />
                </ErrorBoundary>
                <ErrorBoundary failedComponent={`ProductDetails`}>
                    <ProductDetails expandCard={expandCard} />
                </ErrorBoundary>
                {/* <ErrorBoundary failedComponent={`TechnicalDetails`}>
                    <TechnicalDetails expandCard={expandCard} />
                </ErrorBoundary> */}
            </div>
        );
    }
}

export default (MainContentRight);
